unwind and group for the nested array objects in mongodb<p>In mongodb, I have the data structure like this:</p>

<pre><code>{
    "data" : [ 
        {
            "car" : [ 
                {
                    "model" : "aaa",
                }, 
                {
                    "model" : "bbb",
                }, 
                {
                    "model" : "ccc",
                }
            ],
            "user" : {
                "id" : "123"
            }
        }
    ],
}
</code></pre>

<p>And I want to group and count the car model field. So first I tried the unwind method like this:</p>

<pre><code>.aggregate([
  { $project: {"data.car.model":1, "data.user.id":1} },
  { $unwind: {
      path: "$data.car",
      preserveNullAndEmptyArrays: true
      } },
  { $group: {
      _id: "$data.car.model",
      count: { $sum: 1 }
      } }
])
</code></pre>

<p>But the result is:</p>

<pre><code>{
    "_id" : [ ["aaa", "bbb", "ccc"] ],
    "count" : 1.0
}
</code></pre>

<p>which is not what I wanted since the model didn't unwind. The result I'm hoping is: </p>

<pre><code>[{_id:"aaa",count:1}, {_id:"bbb",count:1}, {_id:"ccc", count:1}]
</code></pre>

<p>Then by looked at
<a href="https://stackoverflow.com/questions/40168698/mongodb-unwind-array-nested-inside-an-array-of-documents">mongodb unwind array nested inside an array of documents</a>, I tried the $project the nested array:</p>

<pre><code>.aggregate([
  { $project: {"car":"$data.car.model", "user":"$data.user.id"} },
])
</code></pre>

<p>But the result is:</p>

<pre><code>{
    "car" : [ ["aaa", "bbb", "ccc"] ],
    "user" : ["123"]
}
</code></pre>

<p>As you can see, the car and user was embedded in an array, which I still can't apply the $unwind method. However, I hope it should be like:</p>

<pre><code>{
    "car" : ["aaa", "bbb", "ccc"],
    "user" : "123"
}
</code></pre>

<p>The mongo I'm using is 3.2, I searched a lot on the web but didn't find the answer. Is there possible to do so?</p>

