How to query documents by a condition on the subdocument with the latest date<p>I'm trying to figure out the best way to query documents based on a criteria on <em>the latest</em> subdocument.</p>

<p>So my data might look like this:</p>

<pre><code>[{
  _id: '59bb31efae69726bd5fc9391',
  name: 'Something',
  terms: [
    {
      _id: '58e54f5aad59a6000cdcd590',
      begDate: '2017-06-13T07:00:00.000Z',
      endDate: '2018-01-01T07:59:59.999Z'
    },
    {
      _id: '59bb32765e651d28909ed706',
      begDate: '2018-01-01T08:00:00.000Z',
      endDate: '2019-01-01T07:59:59.999Z'
    }
  ]
}, {
  _id: '59f20ddeef426f6bca3abbf1',
  name: 'Something',
  terms: [
    {
      _id: '59f20e35c8257b5b0f22d2a6',
      begDate: '2018-06-13T07:00:00.000Z',
      endDate: '2019-01-01T07:59:59.999Z'
    },
    {
      _id: '59f20e9394c8108d9db33bf9',
      begDate: '2019-01-01T08:00:00.000Z',
      endDate: '2020-01-01T07:59:59.999Z'
    }
  ]
}]
</code></pre>

<p>What I want is to get all documents whose <strong><em>last term's</em></strong> <code>endDate</code> is <code>2019-01-01T07:59:59.999Z</code> This could be done by either getting the last term in an array, or more reliably sorting terms, and then grabbing the last one.</p>

<p>I can see how I could do this with <a href="https://docs.mongodb.com/manual/reference/operator/query/where/" rel="nofollow noreferrer">$where</a> but I know if I can find another way it would be more performant.</p>

<p>I also want to add, whatever I do here would accompany other query parameters. For example:</p>

<pre><code>{
  _id: {
    '$in': [
      ObjectId("591e5e37abddad14afe1b272"),
      ObjectId("591e5e37abddad14afe1b123")
    ]
  }
}
</code></pre>

<hr>

<p><strong>UPDATE:</strong></p>

<p>As noted, this question has a duplicate (which was hard for me to find as the question referenced is difficult to understand). That being said, I'm not only looking for the last in an array but also the most recent (I agree that's not clear in the body of the question). I'm not arguing against the duplicate question reference, but for the sake of making this easier for future readers, you'll find in the accepted answer a clean solution for mongo 3.6+ as well as a reference to another question in the comments which should help if you want to query <strong><em>by date in subdocuments</em></strong>.</p>

