Is creating a new promise with a async function call bad practice?<p>Snippets are from a node.js and mongoDB CRUD application.<a href="https://github.com/BrianMichaelRomano/nodejs_mongodb_project/blob/master/index.js" rel="nofollow noreferrer">Github repo for full code.</a> The code is working fine but unsure if my structure and use of promises and async await are bad practice.</p>

<pre><code>handlers._newbies = {};

handlers._newbies.post = (parsedReq, res) =&gt; {

    const newbie = JSON.parse(parsedReq.payload);
    databaseCalls.create(newbie)
        .then((result) =&gt; {
            res.writeHead(200,{'Content-Type' : 'application/json'});
            const resultToString = JSON.stringify(result.ops[0]);
            res.write(resultToString);
            res.end();
        })
        .catch(err =&gt; console.log(err));
};


const databaseCalls = {};

databaseCalls.create = (newbie) =&gt; {
    return new Promise(async (resolve, reject) =&gt; {
        try {
            const client = await MongoClient.connect('mongodb://localhost:27017', { useNewUrlParser: true });
            console.log("Connected correctly to server");
            const db = client.db('Noob-List');
            const result = await db.collection('newbies').insertOne(newbie);
            client.close();
            resolve(result);
        } catch(err) {
            console.log(err);
        }
    });
};
</code></pre>

<p>When the node server gets a POST request with the JSON payload, it calls the handlers._newbies.post handler which takes the payload and passed it to the </p>

<pre><code>const newbie = JSON.parse(parsedReq.payload);
databaseCalls.create(newbie)
</code></pre>

<p>call. I want this database call to return a promise that holds the result of the <code>db.collection('newbies').insertOne(newbie);</code>
call. I was having trouble doing this with just returning the promise returned by the insertOne because after returning I cant call <code>client.close();</code>.</p>

<p>Again maybe what I have done here is fine but I haven't found anything online about creating promises with promises in them. Thank you for your time let me know what is unclear with my question.</p>

