Storing custom collection templates in MongoDB<h2>Background</h2>

<p>I'm developing a web application that requires users to create and fill in custom tables (think HTML or MS Word tables, not database tables). The idea is that admins will create the templates for those tables, and general users will fill them in. Each general user can fill their own template, so there will be many tables that use the same template. </p>

<p>Now, these templates can hold any amount of columns, and each column can have a different data type. They can also change over time, meaning there should be versions of them. In other words, once a user fills a template, it should be stored with that structure, even if the template changes in the future. It will keep the old version of the template, while new users will use the newest version.</p>

<p>I usually work with relational databases, but for this scenario, a relational database doesn't seem like a good fit. I feel would end up with a bunch of tables and require many joins to extract the data I need, especially if the database is normalized.</p>

<p>I thought about using something like MongoDB. I'm new to Mongo, so I'm sure I haven't explored every single option, but I thought it would be better idea than using MySQL (what I've used for other apps). Do tell me if I'm wrong about this, though; maybe I'm missing something.</p>

<p>I want to be able to store the templates (name, columns (in order, with their names and data types)), then reuse these templates every time a user wants to fill them in. I would use a collection to store all tables that use the same template version. That is, a collection would be created each time a template is made. The collection should have defined data types that all documents inside should follow. If I'm understanding correctly, MongoDB offers schema validation for this.</p>

<h2>My approach and questions</h2>

<ol>
<li><p>How can I store templates in the database? I thought about storing them as documents in a "templates" collection, which would be something like the example below, but I'm concerned about having the data types as strings. </p>

<pre><code>{
    name: &lt;String&gt;,
    fields: [
        {
            name: &lt;String&gt;,
            type: &lt;String&gt;    &lt;----this is what I have an issue with
        },
        ...
    ]
}
</code></pre>

<p>I would have to read these templates and convert their structure into HTML tables so users can fill them, then store them as documents in the collections with the template name or id.</p>

<p>Something like:</p>

<pre><code>{
    template_id: &lt;uuid, integer, string or something&gt;
    name: &lt;String&gt;,
    rows: [
        {
            &lt;field name&gt;:&lt;field value of specified type&gt;,
            ...
        }
    ]
}
</code></pre></li>
<li><p>How feasible and recommendable is it to create collections on the fly?</p></li>
</ol>

<p>If anything is unclear, let me know so I can clarify. Like I said, I'm new to MongoDB (and non-relational DBs in general), so if I'm missing something obvious, feel free to point it out and offer suggestions. Helpful links to the docs or tutorials are also welcome. I'm also open to trying other NoSQL solutions.</p>

